INSERT INTO `grid_config` VALUES (1,'leave-request','Leave Details','Leave Request dashboard to show all leave Requests.','SELECT lr.id as `Leave Id`,\nDate_Format( lr.applied_date, \'%d-%m-%Y %H:%i\')  as `Applied Date`,\n Date_Format( lr.from_date, \'%d-%m-%Y\') as `From Date`, \nDate_Format( lr.to_date, \'%d-%m-%Y\')  as `To Date`, \nCONCAT(lm.leave_name, \' (\', lr.code, \')\') as `Leave Type`, \nlr.number_of_days as `Number of Days`,\nlr.reason as `Reason`, \nlr.status as `Status`, \nCONCAT(u.name, \' (\', lr.manager, \')\') as `Approver`, \nif(lr.status = \'Pending\', \'Cancel\', null) as `Action`, \nlr.remarks as `Manager Remarks`\n FROM leave_request lr \nJOIN leave_master lm ON lr.code = lm.short_code \n	LEFT JOIN user u ON lr.manager = u.user_id\n			WHERE lr.user_id = \"{userId}\"\n		       AND (lower(\"{leaveTypes}\") = \"null\" OR lr.code IN ({leaveTypes})) \n		       AND (lower(\"{status}\") = \"null\" OR lr.status IN ({status})) \n		       AND (lower(\"{fromDate}\") = \"null\" OR lr.from_date >= \"{fromDate}\") \n		       AND (lower(\"{toDate}\") = \"null\" OR lr.to_date <= \"{toDate}\") \n               AND lr.year = \"{year}\"\n		       ORDER BY lr.applied_date DESC ','{\n  \"params\": {\n        \"filter\": {\n            \"leaveTypes\": {\n                \"type\": \"multi_select\",\n                \"desc\": \"Leave Type\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"leave_type\"\n            },\n            \"status\": {\n                \"type\": \"multi_select\",\n                \"desc\": \"Status\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"leave_status\"\n            },\n            \"fromDate\": {\n                \"type\": \"date\",\n                \"desc\": \"From : \",\n                \"value\": \"\"\n            },\n            \"toDate\": {\n                \"type\": \"date\",\n                \"desc\": \"To : \",\n                \"value\": \"\"\n            }\n        }\n    }\n}\n','{\n	\"Cancel\":{\n		\"type\":\"approve\",\n		\"desc\":\"Cancel\"\n	}\n}',_binary ''),(2,'emp-view-modal','List of Employees','Add Employee For performing the Operations','SELECT \n    NULL AS `Selection`,\n    u1.id AS `Emp ID`,\n    u1.name AS `Emp Name`,\n    u1.organization AS `Organization`,\n    u1.user_id AS `Emp User-ID`,\n    u1.department AS `Department`,\n    u1.designation AS `Designation`,\n    CONCAT(u2.name, \'(\', u1.report_manager, \')\') AS `Report Manager`,\n    u1.location AS `Location`,\n    u1.gender AS `Gender`,\n    u1.email_id AS `Email Id`,\n    u1.contact_no AS `Contact No.`\nFROM\n    user u1\n        LEFT JOIN\n    user u2 ON u1.report_manager = u2.user_id\nWHERE\n    (LOWER(\'{location}\') = \'null\'\n        OR u1.location = \'{location}\')\n        AND (LOWER(\'{department}\') = \'null\'\n        OR u1.department = \'{department}\')\n        AND (LOWER(\'{organization}\') = \'null\'\n        OR u1.organization = \'{organization}\')\n        AND (LOWER(\'{searchTerm}\') = \'null\'\n        OR u1.name LIKE CONCAT(\'%\', \'{searchTerm}\', \'%\')\n        OR u1.id LIKE CONCAT(\'%\', \'{searchTerm}\', \'%\')\n        OR u1.user_id LIKE CONCAT(\'%\', \'{searchTerm}\', \'%\'))\n        AND u1.active = 1\n','{\n  \"params\": {\n        \"filter\": {\n            \"location\": {\n                \"type\": \"select\",\n                \"desc\": \"Location\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"location\"\n            },\n            \"department\": {\n                \"type\": \"select\",\n                \"desc\": \"Department\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"department\"\n            },\n            \"organization\": {\n                 \"type\": \"select\",\n                \"desc\": \"Organization\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"organization\"\n            },\n            \"searchTerm\": {\n                \"type\": \"text\",\n                \"desc\": \"Search by Name/ Emp ID/ User ID\",\n                \"value\": \"\"\n            }\n        }\n    }\n}\n',NULL,_binary ''),(3,'leave-action','Emp Leave Details','Leave Action Dashboard For Approve and declined.','SELECT \n    lr.id AS `Leave Id`, \n    CONCAT(u.name, \' (\', lr.user_id, \')\') AS `Emp Name`,\n    DATE_FORMAT(lr.applied_date, \'%d-%m-%Y %H:%i\') AS `Applied Date`, \n    DATE_FORMAT(lr.from_date, \'%d-%m-%Y\') AS `From Date`, \n    DATE_FORMAT(lr.to_date, \'%d-%m-%Y\') AS `To Date`, \n    CONCAT(lm.leave_name, \'(\', lr.code, \')\') AS `Leave Type`, \n    lr.number_of_days AS `Number of Days`, \n    lr.reason AS `Reason`, \n    lr.status AS `Status`, \n    lr.remarks AS `Manager Remarks`,\n    NULL AS `Action`\nFROM \n    leave_request lr\nJOIN \n    leave_master lm ON lr.code = lm.short_code\nLEFT JOIN\n        user u ON lr.user_id = u.user_id\nWHERE \n    lr.manager = \"{userId}\"\n    AND (LOWER(\"{leaveTypes}\") = \"null\" OR lr.code IN ({leaveTypes}))\n    AND (LOWER(\"{status}\") = \"null\" OR lr.status IN ({status}))\n    AND (LOWER(\"{fromDate}\") = \"null\" OR lr.from_date >= \"{fromDate}\")\n    AND (LOWER(\"{toDate}\") = \"null\" OR lr.to_date <= \"{toDate}\")\n    AND lr.year = \"{year}\"\nORDER BY \n    lr.applied_date DESC\n','{\n  \"params\": {\n        \"filter\": {\n            \"leaveTypes\": {\n                \"type\": \"multi_select\",\n                \"desc\": \"Leave Type\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"leave_type\"\n            },\n            \"status\": {\n                \"type\": \"multi_select\",\n                \"desc\": \"Status\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"leave_status\"\n            },\n            \"fromDate\": {\n                \"type\": \"date\",\n                \"desc\": \"From : \",\n                \"value\": \"\"\n            },\n            \"toDate\": {\n                \"type\": \"date\",\n                \"desc\": \"To : \",\n                \"value\": \"\"\n            }\n        }\n    }\n}\n','{\n	\"Approve\":{\n		\"type\":\"approve\",\n		\"desc\":\"Approve\"\n	},\n        \"Decline\":{\n		\"type\":\"decline\",\n		\"desc\":\"Decline\"\n	},\n         \"View\":{\n		\"type\":\"view\",\n		\"desc\":\"View\"\n	}\n\n}',_binary ''),(4,'add-Employee-dashboard','Registered employees',' Employees Dashboard To add or edit Employees.','SELECT \n    NULL AS `Action`,\n    u1.id AS `Emp ID`,\n    u1.name AS `Emp Name`,\n    u1.organization AS `Organization`,\n    u1.user_id AS `Emp User-ID`,\n    u1.department AS `Department`,\n    u1.designation AS `Designation`,\n    CONCAT(u2.name, \' (\', u1.report_manager, \')\') AS `Reporting Manager`,\n    u1.location AS `Location`,\n    u1.gender AS `Gender`,\n    u1.email_id AS `Email Id`,\n    u1.contact_no AS `Contact No.`,\n    u1.birth_date AS `Birth Date`,\n    u1.anniversary_date AS `Work Anniversary`\nFROM\n    user u1\n        LEFT JOIN\n    user u2 ON u1.report_manager = u2.user_id\nWHERE\n    (LOWER(\'{location}\') = \'null\'\n        OR u1.location = \'{location}\')\n        AND (LOWER(\'{department}\') = \'null\'\n        OR u1.department = \'{department}\')\n        AND (LOWER(\'{organization}\') = \'null\'\n        OR u1.organization = \'{organization}\')\n        AND (LOWER(\'{searchTerm}\') = \'null\'\n        OR u1.name LIKE CONCAT(\'%\', \'{searchTerm}\', \'%\')\n        OR u1.id LIKE CONCAT(\'%\', \'{searchTerm}\', \'%\')\n        OR u1.user_id LIKE CONCAT(\'%\', \'{searchTerm}\', \'%\'))\n        AND u1.active = 1\n','{\n  \"params\": {\n        \"filter\": {\n            \"location\": {\n                \"type\": \"select\",\n                \"desc\": \"Location\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"location\"\n            },\n            \"department\": {\n                \"type\": \"select\",\n                \"desc\": \"Department\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"department\"\n            },\n            \"organization\": {\n                 \"type\": \"select\",\n                \"desc\": \"Organization\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"organization\"\n            },\n            \"searchTerm\": {\n                \"type\": \"text\",\n                \"desc\": \"Search by Name/ Emp ID/ User ID\",\n                \"value\": \"\"\n            }\n        }\n    }\n}\n','{\n	\"Edit\":{\n		\"type\":\"edit\",\n		\"desc\":\"edit\"\n	}\n}',_binary ''),(5,'user-view-modal','Emp leave Detail','User Modal Dashboard For show the leave details by his/her manager.','SELECT lr.id as `Leave Id`, \nDate_Format( lr.applied_date, \'%d-%m-%Y %H:%i\')  as `Applied Date`, \nDate_Format( lr.from_date, \'%d-%m-%Y\') as `From Date`,\n Date_Format( lr.to_date, \'%d-%m-%Y\')  as `To Date`, \nCONCAT(lm.leave_name, \'(\', lr.code, \')\') as `Leave Type`,\n lr.number_of_days as `Number of Days`,\n  lr.reason as `Reason`, lr.status as `Status`, \nCONCAT(u.name, \' (\', lr.manager, \')\') as `Approver`,\n lr.remarks as `Manager Remarks`\n FROM leave_request lr \nJOIN \n      leave_master lm ON lr.code = lm.short_code \nLEFT JOIN \n       user u ON lr.manager = u.user_id\n			WHERE lr.user_id = \"{userId}\"\n		       AND (lower(\"{leaveTypes}\") = \"null\" OR lr.code IN ({leaveTypes})) \n		       AND (lower(\"{status}\") = \"null\" OR lr.status IN ({status})) \n		       AND (lower(\"{fromDate}\") = \"null\" OR lr.from_date >= \"{fromDate}\") \n		       AND (lower(\"{toDate}\") = \"null\" OR lr.to_date <= \"{toDate}\") \n                      AND lr.year = \"{year}\"\n		      ORDER BY lr.applied_date DESC','{\n  \"params\": {\n        \"filter\": {\n            \"leaveTypes\": {\n                \"type\": \"multi_select\",\n                \"desc\": \"Leave Type\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"leave_type\"\n            },\n            \"status\": {\n                \"type\": \"multi_select\",\n                \"desc\": \"Status\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"leave_status\"\n            },\n            \"fromDate\": {\n                \"type\": \"date\",\n                \"desc\": \"From : \",\n                \"value\": \"\"\n            },\n            \"toDate\": {\n                \"type\": \"date\",\n                \"desc\": \"To : \",\n                \"value\": \"\"\n            }\n        }\n    }\n}\n',NULL,_binary ''),(6,'operation-dashboard','Leave Credit/Debit Details','To show Credit/ Debit Leaves Operations Dashboard','SELECT    \n   JSON_UNQUOTE(JSON_EXTRACT(al.op_params, \'$.action\')) AS `Actions`,\nCONCAT(lm.leave_name , \' (\' , JSON_UNQUOTE(JSON_EXTRACT(al.op_params, \'$.leave_type\'))  , \')\') AS `Leave Type`,\n    al.status as `Status`, \n    JSON_UNQUOTE(JSON_EXTRACT(al.op_params, \'$.quantity\')) AS `Quantity`,\n     al.reason as `Reason`,\nreplace(replace(replace(JSON_UNQUOTE(JSON_EXTRACT(al.op_params, \'$.users\')), \'\"\',\'\'),\'[\',\'\'),\']\',\'\') AS `Employees`,\n  CONCAT(u.name, \' (\', al.updated_by, \')\') as `Updated By`, \n    Date_Format(al.updated_on, \'%d-%m-%Y %H:%i\') as \'Updated On\'\nFROM  \n    audit_logs al \nJOIN \n    operation_master op ON al.op_code = op.op_code\nLEFT JOIN\n    user u ON al.updated_by = u.user_id\nLEFT JOIN\n       leave_master lm ON  JSON_UNQUOTE(JSON_EXTRACT(al.op_params, \'$.leave_type\')) = lm.short_code\nWHERE \n    al.updated_by = \"{userId}\"\n    AND (lower(\"{action}\") = \'null\' OR JSON_UNQUOTE(JSON_EXTRACT(al.op_params, \'$.action\')) = \"{action}\")\n    AND (lower(\"{status}\") = \'null\' OR al.status = \"{status}\")\n    AND (lower(\"{fromDate}\") = \'null\' OR al.updated_on >= \"{fromDate}\") \n    AND (lower(\"{toDate}\") = \'null\' OR al.updated_on <= \"{toDate}\") \n    AND al.year = \"{year}\"\nORDER BY \n    al.updated_on DESC\n','{\n  \"params\": {\n        \"filter\": {\n            \"action\": {\n            \"type\": \"select\",\n            \"desc\": \"Add/Remove Leave\",\n            \"value\": \"\",\n            \"sourceType\": \"ref_master\",\n            \"sourceId\": \"leave_action\"\n        },\n            \"status\": {\n                \"type\": \"select\",\n                \"desc\": \"Status\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"op_status\"\n            },\n            \"fromDate\": {\n                \"type\": \"date\",\n                \"desc\": \"From : \",\n                \"value\": \"\"\n            },\n            \"toDate\": {\n                \"type\": \"date\",\n                \"desc\": \"To : \",\n                \"value\": \"\"\n            }\n        }\n    }\n}\n','{\n	\"show\":{\n		\"type\":\"show\",\n		\"desc\":\"Emp-Details\"\n	}\n}',_binary ''),(7,'emp-details-modal','Employee Details','Modal for displaying employee details for any operations performed on that employee','SELECT \n    u1.id AS `Emp ID`,\n    u1.name AS `Emp Name`,\n    u1.organization AS `Organization`,\n    u1.user_id AS `Emp User-ID`,\n    u1.department AS `Department`,\n    u1.designation AS `Designation`,\n    CONCAT(u2.name, \' (\', u1.report_manager, \')\') AS `Report Manager`,\n    u1.location AS `Location`,\n    u1.gender AS `Gender`,\n    u1.email_id AS `Email Id`,\n    u1.contact_no AS `Contact No.`\nFROM\n    user u1\n        LEFT JOIN\n    user u2 ON u1.report_manager = u2.user_id\nWHERE\n    (LOWER(\'{location}\') = \'null\'\n        OR u1.location = \'{location}\')\n        AND (LOWER(\'{department}\') = \'null\'\n        OR u1.department = \'{department}\')\n        AND (LOWER(\'{organization}\') = \'null\'\n        OR u1.organization = \'{organization}\')\n        AND (LOWER(\'{searchTerm}\') = \'null\'\n        OR u1.name LIKE CONCAT(\'%\', \'{searchTerm}\', \'%\')\n        OR u1.id LIKE CONCAT(\'%\', \'{searchTerm}\', \'%\')\n        OR u1.user_id LIKE CONCAT(\'%\', \'{searchTerm}\', \'%\'))\n        AND u1.active = 1\n        AND u1.user_id IN ({userId})\n','{\n  \"params\": {\n        \"filter\": {\n            \"location\": {\n                \"type\": \"select\",\n                \"desc\": \"Location\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"location\"\n            },\n            \"department\": {\n                \"type\": \"select\",\n                \"desc\": \"Department\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"department\"\n            },\n            \"organization\": {\n                 \"type\": \"select\",\n                \"desc\": \"Organization\",\n                \"value\": \"\",\n                \"sourceType\": \"ref_master\",\n                \"sourceId\": \"organization\"\n            },\n            \"searchTerm\": {\n                \"type\": \"text\",\n                \"desc\": \"Search by Name/ Emp ID/ User ID\",\n                \"value\": \"\"\n            }\n        }\n    }\n}\n',NULL,_binary ''),(8,'Define Type','Define Type','For adding new types.','SELECT c_type_id `Type Id`, c_type_name `Type Name`, c_parent_type `Parent Type`  FROM entity_type_master\nWHERE\n(LOWER(\'{searchTypeName}\') = \'null\'\n  or c_type_name LIKE CONCAT(\'%\', \'{searchTypeName}\', \'%\'))\n\nAND (LOWER(\'{parentType}\') = \'null\'\n       or c_parent_type LIKE CONCAT(\'%\', \'{parentType}\', \'%\'))\n        AND active = 1','{\n  \"params\": {\n        \"filter\": {\n            \"searchTypeName\": {\n                \"type\": \"text\",\n                \"desc\": \"Name\",\n                \"value\": \"\"\n            }, \n            \"parentType\":{\n                \"type\": \"text\",\n                \"desc\": \"Parent Name\",\n                \"value\": \"\"\n            }\n        }\n    }\n}',NULL,_binary '');
